import './App.css';

import React from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";


function App() {

  return (

    <Router>
      <div>
        <nav>
          <h1>Menu</h1>
          <ul className='list'>
            <li>
              <Link to="/">Breakfast</Link>
            </li>
            <li>
              <Link to="/about">Lunch</Link>
            </li>
            <li>
              <Link to="/users">Shakes</Link>
            </li>
          </ul>
        </nav>

        {/* A <Switch> looks through its children <Route>s and
            renders the first one that matches the current URL. */}
        <Routes>
          <Route path="/" element={<Breakfast />} />
          <Route path="/about" element={<Lunch />} />
          <Route path="/users" element={<Shakes />} />
        </Routes>
      </div>
    </Router>


  );
}

function Breakfast() {
  return (

    <div className="card">
      <img src="./components/images/item-1.jpeg" alt="Resim" className="card-img" />
      <div className="card-content">
        <h2>Başlık</h2>
        <p>İçerik</p>

      </div>
    </div>
  )
}
function Lunch() {
  return <h2>Lunch</h2>;
}

function Shakes() {
  return <h2>Shakes</h2>;
}

export default App;
